import React, { useState } from "react";
import Dropdown from "react-bootstrap/Dropdown";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  const [showMovie, setShowMovie] = useState(false);

  return (
    <div className="nav-container">
      <NavLink to="/">
        <img src="./img/logo.png" alt="" className="logo" />
      </NavLink>

      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
          Films
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <NavLink to="/Populaires">
            <Dropdown.Item href="#/action-1">Populaires</Dropdown.Item>
          </NavLink>
          <NavLink to="/DuMoment">
            <Dropdown.Item href="#/action-2">Du moment</Dropdown.Item>
          </NavLink>
          <NavLink to="/Avenir">
            <Dropdown.Item href="#/action-3">À venir</Dropdown.Item>
          </NavLink>
          <NavLink to="/LesMieuxNotés">
            <Dropdown.Item href="#/action-3">Les mieux notés</Dropdown.Item>
          </NavLink>
        </Dropdown.Menu>
      </Dropdown>
    </div>
  );
};

export default Navbar;
